PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
CREATE TABLE provider (
	id INTEGER NOT NULL, 
	name VARCHAR(64) NOT NULL, 
	kwh_cost FLOAT NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE station (
	id INTEGER NOT NULL, 
	country VARCHAR(64) NOT NULL, 
	city VARCHAR(64) NOT NULL, 
	street VARCHAR(64) NOT NULL, 
	number INTEGER NOT NULL, 
	avg_rating FLOAT, 
	num_ratings INTEGER NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE user (
	id INTEGER NOT NULL, 
	username VARCHAR(64) NOT NULL, 
	is_admin BOOLEAN NOT NULL, 
	password_hash VARCHAR(256) NOT NULL, 
	token VARCHAR(32), 
	first_name VARCHAR(64) NOT NULL, 
	last_name VARCHAR(64) NOT NULL, 
	country VARCHAR(64) NOT NULL, 
	city VARCHAR(64) NOT NULL, 
	street VARCHAR(64) NOT NULL, 
	number INTEGER NOT NULL, 
	zip_code VARCHAR(5) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (token), 
	UNIQUE (username), 
	CHECK (is_admin IN (0, 1))
);
CREATE TABLE bill (
	id INTEGER NOT NULL, 
	user_id INTEGER, 
	period_start_date VARCHAR(30) NOT NULL, 
	period_end_date VARCHAR(30) NOT NULL, 
	total_cost FLOAT, 
	is_paid BOOLEAN NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES user (id), 
	CHECK (is_paid IN (0, 1))
);
CREATE TABLE card (
	user_id INTEGER, 
	card_number VARCHAR(16) NOT NULL, 
	card_expiration VARCHAR(4) NOT NULL, 
	cvc_code INTEGER NOT NULL, 
	PRIMARY KEY (card_number), 
	FOREIGN KEY(user_id) REFERENCES user (id)
);
CREATE TABLE vehicle (
	user_id INTEGER, 
	registration_plate VARCHAR(10) NOT NULL, 
	manufacturer VARCHAR(64) NOT NULL, 
	model VARCHAR(64) NOT NULL, 
	PRIMARY KEY (registration_plate), 
	FOREIGN KEY(user_id) REFERENCES user (id), 
	UNIQUE (registration_plate)
);
CREATE TABLE session (
	id INTEGER NOT NULL, 
	user_id INTEGER, 
	station_id INTEGER, 
	registration_plate VARCHAR(10), 
	starting_time VARCHAR(30) NOT NULL, 
	finishing_time VARCHAR(30) NOT NULL, 
	kwh_cost FLOAT NOT NULL, 
	kwh_delivered FLOAT NOT NULL, 
	provider_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(provider_id) REFERENCES provider (id), 
	FOREIGN KEY(registration_plate) REFERENCES vehicle (registration_plate), 
	FOREIGN KEY(station_id) REFERENCES station (id), 
	FOREIGN KEY(user_id) REFERENCES user (id)
);
COMMIT;
